end	

--state machine
function stateMachine()

if(gameState == 0) then menu() 
elseif(gameState == 1) then  begin()
elseif(gameState == 2) then game() 
elseif(gameState == 3) then credits() 
elseif(gameState == 4) then tutorial()
elseif(gameState == 5) then score()
end

end

