function changeDir(object)
	if object.isStepX then
		if object.dx > 0 then
			object.dx = 0-object.dx
		else
			object.dx = math.abs(object.dx)
		end
	else
		if object.dy > 0 then
			object.dy = 0-object.dy
		else
			object.dy = math.abs(object.dy)
		end
	end
end


function collision()
	
	for id, weaponInUsage in pairs(weapon) do
		for id2, badFurniture in pairs(furniture) do
			if((math.ceil(weaponInUsage.x)<=badFurniture.x+badFurniture.width and math.ceil(weaponInUsage.x)>=badFurniture.x-badFurniture.width) 
			and (math.ceil(weaponInUsage.y)<=badFurniture.y+badFurniture.heigth and math.ceil(weaponInUsage.y)>=badFurniture.y-badFurniture.heigth)) then
				
				if(weaponInUsage.lives >0) then 
					weaponInUsage.lives=weaponInUsage.lives-1
					changeDir(weaponInUsage)
				else
					table.remove(weapon,id)
				end
				table.remove(furniture, id2)
				
			end
		end
	end

end

function playerCollision()
	for id, badFurniture in pairs(furniture) do
		if((math.ceil(player.x)<=badFurniture.x+badFurniture.width and math.ceil(player.x)>=badFurniture.x-badFurniture.width) 
		and (math.ceil(player.y)<=badFurniture.y+badFurniture.heigth and math.ceil(player.y)>=badFurniture.y-badFurniture.heigth)) then
			if player.hp > 0 then 
				if(canHit) then 
					player.hp  = player.hp - 20
					canHit = false
					hit = true
				end
			else
				gameState=5
				tFinal = math.ceil(t/60)
			end
		end
	end
end




function spriteReturn(animation, n, acceleration, n0)

	hangerSpriteNumber = animation[math.ceil((t/acceleration)%n)]

	if(hangerSpriteNumber == nil) then 
		hangerSpriteNumber = n0
	end
	
	return hangerSpriteNumber
end





function playerMovement()
	if btn(0) then
		up=1
		down=0
		right=0
		left=0 
		player.y=player.y-1*inverted 
	end
	if btn(1) then
		up=0
		down=1
		right=0
		left=0  
		player.y=player.y+1*inverted 
	end 
	if btn(3)  then
		up=0
		down=0
		right=1
		left=0 
		player.x=player.x+1*inverted
	end
	if btn(2)  then
		up=0
		down=0
		right=0
		left=1
		player.x = player.x-1*inverted
	end
	checkBounds()

end


function checkBounds()
	if player.x < BORDER_LEFT then
		player.x = BORDER_LEFT
	end
	if player.x > BORDER_RIGHT then
		player.x = BORDER_RIGHT
	end
	if player.y < BORDER_TOP then
		player.y = BORDER_TOP
	end
	if player.y > BORDER_BOT then
		player.y = BORDER_BOT
	end
end

function createWeapons(lastX,lastY)
	dx=lastX-player.x
	dy=lastY-player.y
	if math.abs(dx) >= math.abs(dy) then 
		step = math.abs(dx)  
		boolTemp = true
	else 
		step = math.abs(dy) 
		boolTemp = false
	end
	
	local newWeapon={
		x=player.x,
		y=player.y-5,
		destX=lastX,
		destY=lastY,
		dx = dx/step,
		dy= dy/step,
		isStepX=boolTemp,
		lives=2
		
	}
	
	table.insert(weapon,#weapon+1,newWeapon)
end


function shoot()
	if (mouseVars.pressed and canShoot) then
		
		createWeapons(mouseVars.x,mouseVars.y)
		hangerShot = true
		canShoot = false
	end
end

function updateWeapon()
	
	for id, eachWeapon in pairs(weapon) do
		eachWeapon.x=eachWeapon.x + eachWeapon.dx
		eachWeapon.y=eachWeapon.y + eachWeapon.dy
		drawWeapon()
	end
end

function drawWeapon()
	checkWeaponBoundsAndLives()
	
	for id,eachWeapon in pairs(weapon) do
		if eachWeapon.x < midPosLeft and player.isLeftSide then
			spr(spriteReturn(hangerAnimation, 4, 3, hangern0),eachWeapon.x,eachWeapon.y,6,1,0,0,2,2)
			spr(spriteReturn(hangerAnimation, 4, 3, hangern0),239-14-eachWeapon.x,eachWeapon.y,6,1,1,0,2,2)
		elseif (eachWeapon.x > midPosRight and not player.isLeftSide) then
			spr(spriteReturn(hangerAnimation, 4, 3, hangern0),eachWeapon.x,eachWeapon.y,6,1,0,0,2,2)
			spr(spriteReturn(hangerAnimation, 4, 3, hangern0),239-14-eachWeapon.x,eachWeapon.y,6,1,1,0,2,2)
		end
	end
end


function checkWeaponBoundsAndLives()
	for id, eachWeapon in pairs(weapon) do

		if eachWeapon.y <= BORDER_TOP then
			eachWeapon.y = BORDER_TOP + 1
			eachWeapon.lives = eachWeapon.lives - 1
			changeDir(eachWeapon)
		
		elseif eachWeapon.y >= BORDER_BOT then
			eachWeapon.y = BORDER_BOT - 1
			eachWeapon.lives = eachWeapon.lives - 1
			changeDir(eachWeapon)
		
		elseif eachWeapon.x >= BORDER_RIGHT then
			eachWeapon.x = BORDER_RIGHT - 1
			eachWeapon.lives = eachWeapon.lives - 1
			changeDir(eachWeapon)
		elseif eachWeapon.x <= BORDER_LEFT then
			eachWeapon.x = BORDER_LEFT + 1
			eachWeapon.lives = eachWeapon.lives - 1
			changeDir(eachWeapon)
		elseif eachWeapon.lives<=0 then
			table.remove(weapon,id)
		end
	end
end


function drawPlayer()
	if(left==1) then
		spr(spriteReturn(characterSidewaysLeft,4,30,422),player.x,player.y,14,1,0,0,2,2)
		spr(spriteReturn(characterSidewaysLeft,4,30,422),239-16-player.x,player.y,14,1,1,0,2,2)
	elseif(up==1) then
		spr(spriteReturn(characterAnimationUp, 4, 30, 295),player.x,player.y,14,1,0,0,2,2)
		spr(spriteReturn(characterAnimationUp, 4, 30, 295),239-16-player.x,player.y,14,1,1,0,2,2)
	elseif(down==1) then
		spr(spriteReturn(characterAnimationDown, 4, 30, 390),player.x,player.y,14,1,0,0,2,2)
		spr(spriteReturn(characterAnimationDown, 4, 30, 390),239-16-player.x,player.y,14,1,1,0,2,2)
	elseif(right==1) then
		spr(spriteReturn(characterSidewaysRight, 4, 30, 454),player.x,player.y,14,1,0,0,2,2)
		spr(spriteReturn(characterSidewaysRight, 4, 30, 454),239-16-player.x,player.y,14,1,1,0,2,2)
	else
		spr(spriteReturn(characterSidewaysRight, 4, 30, 454),player.x,player.y,14,1,0,0,2,2)
		spr(spriteReturn(characterSidewaysRight, 4, 30, 454),239-16-player.x,player.y,14,1,1,0,2,2)
	end
end


function updateMouse()
	mouseVars.x,mouseVars.y,mouseVars.pressed=mouse()
end


function drawCrossair()
	spr(256,mouseVars.x-2,mouseVars.y-2,14,1,0,0)
	spr(256,239-2-mouseVars.x,mouseVars.y-2,14,1,0,0)
	
end


function position(object)
	if object.x >= midPosLeft and object.isLeftSide then
		object.isLeftSide = false
		if object.x <= midPosRight then
			object.x = midPosRight + 1
		end
	elseif object.x <= midPosRight and not object.isLeftSide then
		object.isLeftSide = true
		if object.x >= midPosLeft then
			if(object.type == "drawer" or object.type == "wardrobe") then
				object.x = midPosLeft - 17
			else
				object.x = midPosLeft - 1
			end 
		end
	end
end


function createFurniture()

	type_t = ""

	local choice = math.ceil(math.random(0,1))

	if(choice == 0) then 
		type_t = "wardrobe"
	else
		type_t = "drawer"
	end

	yPos = math.random(12, 100)
	

	local newFurniture={
		x=12+(choice*200),
		y=yPos,
		width=16,
		heigth=16,
		type = type_t,
		isLeftSide = true,
	}

	table.insert(furniture,#furniture+1,newFurniture)
	
end


function updateFurniture()
	for id, eachPiece in pairs(furniture) do
		if(eachPiece.x > player.x and eachPiece.y > player.y) then
			eachPiece.x = eachPiece.x-0.2
			eachPiece.y = eachPiece.y-0.2
		elseif(eachPiece.x < player.x and eachPiece.y < player.y) then
			eachPiece.x = eachPiece.x+0.2
			eachPiece.y = eachPiece.y+0.2
		elseif(eachPiece.x > player.x and eachPiece.y < player.y) then
			eachPiece.x = eachPiece.x-0.2
			eachPiece.y = eachPiece.y+0.2
		elseif(eachPiece.x < player.x and eachPiece.y > player.y) then
			eachPiece.x = eachPiece.x+0.2
			eachPiece.y = eachPiece.y-0.2
		end
		drawFurniture()
	end

end


function positionFurniture()
	for id, eachPiece in pairs(furniture) do
		position(eachPiece)
	end
end


